const Searchbar = ({ fetchTeams, teams }) => {
  const handleSearch = event => {
    event.preventDefault();
    console.log('Search...')
  };

  return (
    <section>
      <button onClick={fetchTeams('PL')}></button>
      <form onSubmit={handleSearch}>
        <label htmlFor="searchLeague">Search league:</label>
        <input type="text" id="searchLeague" onChange={fetchTeams}/>
        <input type="submit" value="Submit" />
      </form>
      {teams.map((team, i) => <div>{teams.name}</div>)}
    </section>
  )
};

export default Searchbar;
